import React from 'react';
import Category from './Category';

const ProductList = () => {
  return (
    <div>
      <Category />
      <input placeholder='Enter Search Here!'></input>
      <select>
        <option>Default Sorting</option>
        <option>b</option>
        <option>c</option>
        <option>d</option>
      </select>
    </div>
  );
};

export default ProductList;
